window.bookSummaryJSON = "<p><i>One platoon of Rangers from a legendary regiment. An isolated combat outpost in the Spin Ghar mountains. One-hundred-fifty Taliban survivors - armed with Tier-1 weapons - And all the rampaging dead guys in central Asia.</i></p> <p>B Company, 3rd Bat, 75th Ranger Regiment - a unit that's fought in every US engagement from D-Day to Black Hawk Down. They are the last American boots on the ground in the entire Syrian civil war...on the last day before the Fall of human civilization. When they are tasked with stopping a unit of Spetsnaz operators from inserting under the chaos, an advanced Russian Navy frigate becomes the last place left on Earth for the Rangers to find refuge. Now, after six months held captive as scavenging mercenaries for Spetsnaz, to earn their freedom they will have to take on the most hazardous shore mission in the entire history of the ZA.</p> <p>Welcome to the Zulu Alpha.</p> <p><b>Devastation. Devotion. Sacrifice.</b></p> <p><i>Last Stand</i></p>"; 
